//Vai importar a pasta o InputGroup
import InputGroup from './components/InputGroup'


function App() {
  return (
    <div className="App">
    <h1>Ol√° react</h1>
    <InputGroup 
    label='Nome' 
    type='text'
     placeholder='digite seu nome'
     />
    <InputGroup 
    label='senha' 
    type='password'
     placeholder='digite seu senha'/>
    <InputGroup label='email' type='email' placeholder='digite seu email'/>
    <InputGroup label='telefone' type='tel' placeholder='digite seu telefone'/>
    </div>
  );
}
export default App;
